import React, { useState, useEffect } from "react";
import Styles from "./AnimatedQuote.module.css";
import Typical from "react-typical";
export default function AnimatedQuote(props) {
	const quoteText = "I love you, not only for what you are, but for what...";
	const arr = quoteText.split("");
	console.log(arr);
	return (
		<div style={{ fontSize: "50px" }}>
			<Typical
				className={Styles.quote}
				steps={["Hello", 2000, "Hello world!", 500]}
				loop={2}
				wrapper="p"
			/>
		</div>
	);
}
